import { createTheme, ThemeProvider } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import Avatar from '@mui/material/Avatar'; // Import the Avatar component
import deepRacerLogo from '../assets/deepracer.png'; // Import the image
import rmitLogo from '../assets/rmit.png'

const drawerWidth = 240;
const theme = createTheme({
  typography: {
    h6: {
      fontWeight: 1, // Replace 'YourCustomFont' with the name of your font family
    },
  },
});
export default function Sidenav() {
  return (
      <Drawer
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
            backgroundColor:'#1A1A1A',
            color:'#FF9900'
          },
        }}
        variant="permanent"
        anchor="left"
      >
        <Toolbar />
        <Box display="flex" alignItems="center">
        <Avatar alt="RMIT Logo" src={rmitLogo} sx={{width:100}}/>
        <Avatar alt="DeepRacer logo" src={deepRacerLogo}/>
        </Box>
        <List>
          {/* Accounts Icon */}
          <ListItem disablePadding>
            <ListItemButton>
              <ListItemIcon sx={{color:'#FF9900'}}>
                <AccountCircleIcon />
              </ListItemIcon>
              <ListItemText primary="Accounts" />
            </ListItemButton>
          </ListItem>
        </List>
        <Divider />
        <List>
          {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
            <ListItem key={text} disablePadding>
              <ListItemButton>
              <ListItemIcon sx={{color:'#FF9900'}}>
                  {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                </ListItemIcon>
                <ListItemText primary={text} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
        <Divider />
        <List>
          {['All mail', 'Trash', 'Spam'].map((text, index) => (
            <ListItem key={text} disablePadding>
              <ListItemButton>
              <ListItemIcon sx={{color:'#FF9900'}}>
                  {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                </ListItemIcon>
                <ListItemText primary={text} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
      </Drawer> 
  );
}
